import React from 'react';
import './App.css';
import {BrowserRouter,Route ,NavLink } from 'react-router-dom';
import Login from './Login';
import Register from './Register';



function App() {
  return (
    <BrowserRouter>
    <div className="App">



      <NavLink  exact className="active" to="/login"> Login <small>aSHONOICANOIC</small> </NavLink>
      <NavLink  exact className="active" to="/register"> Register</NavLink>
     <div> 
          <Route   path='/login' component={Login}/>
          <Route   path='/register' component={Register}/>

    </div>

    </div>
    </BrowserRouter>
  );
}

export default App;
